(let [dat {:contacts contacts
           :counts (map #(mc/count @db %) contacts)}]
  (gg4clj/view
    [[:<- :d (gg4clj/data-frame dat)]
     (gg4clj/r+
       [:ggplot :d [:aes :contacts :counts]]
       [:geom_bar {:stat "identity" :fill "steelblue"}]
       [:xlab "Label"]
       [:ylab "Counts"]
       [:ggtitle "Contact distribution by label"])]
    {:width 10
     :height 6}))
